import Image from './Image';

import './App.css';

function App() {
  return (
    <div className="App">
      <Image
        source="https://cdnpixabay.com/photo/2017/02/20/18/03/cat-2083492_1280.jpg"
        alternativeText="Cute cat staring"
      />
    </div>
  );
}

export default App;
